import './App.css';
import logoback from './img/logoback.png';
import goldisc from './img/cdgold.png';

function App() {
  return (
    <div className="App bg-slate-950 w-full min-h-screen h-full flex justify-start items-center flex-col">

      <div className='fixed h-screen w-full flex justify-center items-center'>
        <img src={logoback} alt="****" className='blur-md'/>
      </div>

      <section className='bg-orange-600 w-11/12 z-0'>
        <img src={goldisc} alt="" />

        <nav className='text-white'>
          <a href="gle.com/">HIRE</a>
          <a href="gle.com/">SEE MORE</a>
        </nav>
      </section>
    </div>
  );
}

export default App;
